s.aP(0,"Raycasting (light)",new A.b6H(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raycast_light_example.dart","In this example the raycast functionality is showcased by using it as a light\nsource, if you move the mouse around the canvas the rays will be cast from its\nlocation. You can also tap to create a permanent source of rays that wont move\nwith with mouse.\n  ")
s.aP(0,"Raycasting",new A.b6I(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raycast_example.dart","In this example the raycast functionality is showcased. The circle moves around\nand casts 10 rays and checks how far the nearest hitboxes are and naively moves\naround trying not to hit them.\n  ")
s.aP(0,"Raytracing",new A.b6J(),"https://github.com/flame-engine/flame/blob/main/examples/lib/stories/collision_detection/raytrace_example.dart","In this example the raytrace functionality is showcased.\nClick to start sending out a ray which will bounce around to visualize how it\nworks. If you move the mouse around the canvas, rays and their reflections will\nbe moved rendered and if you click again some more objects that the rays can\nbounce on will appear.\n  ")
